import React, { useState, useEffect } from "react";
import axios from 'axios';
import { useParams } from 'react-router-dom';

import MenuNav from "../Components/MenuNav";

function Order() {
    let { code } = useParams();
    return (
        <div className="order">
            <MenuNav />
        </div>
    );
}

export default Order;
